import React from "react";
import Button from "./Button";

function DetailExpence(props) {
  return (
    <div
      onClick={props.onClick}  
    style={{
        display: "flex",
        paddingTop: 10,
        backgroundColor: "#373737",
        color: "white",
        margin: '10',
        borderRadius: "15px",
        alignItems: "center",
        width: "95%",
        justifyContent: "space-between",
      }}
    >
      <div
        style={{
          display: "flex",
          alignItems: "center",
        }}
      >
        <div
          style={{
            border: "1px solid white",
            backgroundColor: "#1d1d1d",
            display: "flex",
            flexDirection: "column",
            height: 100,
            width: 100,
            alignItems: "center",
            justifyContent: "center",
            borderRadius: "10px",
            marginLeft: 10,
            marginBottom: 10,
          }}
        >
          <div>
            <b>{props.month}</b>
          </div>
          <div>{props.year}</div>
          <div
            style={{
              fontSize: 30,
              fontWeight: "bold",
            }}
          >
            {props.date}
          </div>
        </div>
        <div
          style={{
            fontSize: 20,
            fontWeight: "bold",
            marginLeft: 20,
          }}
        >
          <b>{props.title}</b>
        </div>
      </div>
      <div>
        <b>
          <Button
            name={"$ " + props.amount}
            bgColor="#37004f"
            fcolor="white"
            sborder="1px solid rgb(255, 255, 255)"
            fWeight="700"
            handleClick={(e) => {
              e.preventDefault();
            }}
          />
        </b>
      </div>
    </div>
  );
}

export default DetailExpence;
